package leetcode.weekly.r278;

import java.util.*;
import java.io.*;

public class Solution {
    static PrintWriter pw;

    // TLE
    public String subStrHash(String s, int p, int mod, int k, int hashValue) {
        int n = s.length();
        for (int i = 0; i < n; i++) {
            String t = s.substring(i, i + k);
            int len = t.length();
            if (len != k) continue;
            long v = hash(t, p, mod);
            // tr(t, v);
            if (v == hashValue) return t;
        }
        return null;
    }

    long hash(String s, int p, int mod) {
        int n = s.length();
        long sum = 0;
        for (int i = 0; i < n; i++) {
            int val = s.charAt(i) - 'a' + 1;
            long pp = pow_mod(p, i, mod);
            long each = val * pp;
            sum += each;
        }
        sum %= mod;
        return sum;
    }

    long pow_mod(long a, long b, int mod) {
        long r = 1;
        while (b > 0) {
            if (b % 2 == 1) r = r * a % mod;
            b >>= 1;
            a = a * a % mod;
        }
        return r;
    }

    public void run() {
        String s = "leetcode";
        int power = 7, modulo = 20, k = 2, hashValue = 0;
        String s2 = "fbxzaad";
        int power2 = 31, modulo2 = 100, k2 = 3, hashValue2 = 32;
        String s_debug1 = "xmmhdakfursinye";
        int power_debug1 = 96, modulo_debug1 = 45, k_debug1 = 15, hashValue_debug1 = 21;
        String s_debug2 = "xqgfatvtlwnnkxipmipcpqwbxihxblaplpfckvxtihonijhtezdnkjmmk";
        int power_debug2 = 22, modulo_debug2 = 51, k_debug2 = 41, hashValue_debug2 = 9;
//        tr(subStrHash(s, power, modulo, k, hashValue));
//        tr(subStrHash(s2, power2, modulo2, k2, hashValue2));
//        tr(subStrHash(s_debug1, power_debug1, modulo_debug1, k_debug1, hashValue_debug1));
//        tr(subStrHash(s_debug2, power_debug2, modulo_debug2, k_debug2, hashValue_debug2));
    }

    public static void main(String[] args) {
        pw = new PrintWriter(System.out);
        new Solution().run();
        pw.close();
    }

    void tr(Object... o) {
        pw.println(Arrays.deepToString(o));
    }
}

